import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const Search = () => {
    return (
        <View style={styles.container}>
            <Text>Search</Text>
        </View>
    );
};

const styles = StyleSheet.create({
    container: {
        flexDirection: "row",
        justifyContent: 'center',
        alignItems: 'center',
    },
});

export default Search; // Ensure the export is named correctly as well
